import {Component, Inject, OnInit} from '@angular/core';
import {PaymentService} from '../../_shared/services/payment.service';
import {ToastrService} from 'ngx-toastr';
import {MatDialogRef} from '@angular/material';
import {PaymentHistoryComponent} from '../payment-history/payment-history.component';
import * as jsPDF from 'jspdf';

@Component({
  selector: 'app-dialog-payment-summary',
  templateUrl: './dialog-payment-summary.component.html',
  styleUrls: ['./dialog-payment-summary.component.scss']
})
export class DialogPaymentSummaryComponent implements OnInit {

  // tslint:disable-next-line:max-line-length
  // private imgData = 'data:image/png;base64,';
  constructor(public paymentService: PaymentService,
              private toastr: ToastrService,
              private dialogRef: MatDialogRef<PaymentHistoryComponent>) { }

  ngOnInit() {
  }


  print() {


    /**
     * Documentation: http://raw.githack.com/MrRio/jsPDF/master/#
     */
    const doc = new jsPDF();

    doc.setFont('helvetica');
    doc.setFontSize(24);
    doc.setFontStyle('bold');
    doc.text('BOWEN UNIVERSITY', 105, 20, null, null, 'center');

    // const imgData = 'data:image/png;base64,';
    const imgData = 'data:image/png;base64,';

    doc.setFontSize(18);
    doc.setFontStyle('italic');
    doc.setTextColor(128, 128, 128);
    doc.text('(Of the Nigerian Baptist Convention)', 105, 30, null, null, 'center');

    doc.setFontStyle('normal')
    doc.text('Iwo, Osun State, Nigeria', 105, 40, null, null, 'center');

    doc.setFont('courier');
    doc.setFontSize(18);
    doc.setFontStyle('bold');
    doc.setTextColor(0, 0, 0);
    doc.text('Transcript Payment Receipt', 105, 60, null, null, 'center');

    doc.setLineWidth(0.1)
    doc.setDrawColor(0, 0, 0);

    doc.line(10, 65, 200, 65);

    /*
     *  Set Receipt Name:
     */
    doc.setFontStyle('bold');
    doc.setFontSize(14);
    doc.text('Name:', 27, 90);

    doc.setFontStyle('normal');
    doc.text(this.paymentService.form.get('name').value, 120, 90);

    /*
        Set Matric No
     */
    doc.setFontStyle('bold');
    doc.setFontSize(14);
    doc.text('Matric No:', 27, 105);

    doc.setFontStyle('normal');
    doc.text(this.paymentService.form.get('mat_no').value, 120, 105);

    /*
        Set Amount
     */
    doc.setFontStyle('bold');
    doc.setFontSize(14);
    doc.text('Amount:', 27, 120);

    doc.setFontStyle('normal');
    doc.text(this.currencyFormat(this.paymentService.form.get('amount').value), 120, 120);

    /*
        Payment Status
     */
    doc.setFontStyle('bold');
    doc.setFontSize(14);
    doc.text('Payment Status:', 27, 135);

    doc.setFontStyle('normal');
    doc.text(this.paymentService.form.get('status').value, 120, 135);

    /*
        Transaction Id
     */
    doc.setFontStyle('bold');
    doc.setFontSize(14);
    doc.text('Transaction Code:', 27, 150);

    doc.setFontStyle('normal');
    doc.text(this.paymentService.form.get('txRef').value, 120, 150);

    /*
        Transaction Date
     */
    doc.setFontStyle('bold');
    doc.setFontSize(14);
    doc.text('Transaction Date:', 27, 165);

    doc.setFontStyle('normal');
    doc.text(this.paymentService.form.get('date').value, 120, 165);

    /*
        Add footer
     */
    doc.setFont('helvetica');
    doc.setFontStyle('normal');
    doc.setFontSize(11);
    doc.setTextColor(
        211, 211, 211
    );
    doc.text('Printed: ' + new Date().toDateString() + ' ' + new Date().toTimeString(), 15, 287);
    doc.text('Page 1 of 1', 165, 287);

    // add water mark to the page
    // doc = this.addWaterMark(doc);
    doc.addImage(imgData, 'PNG', (doc.internal.pageSize.width / 2) - (128 / 2), (doc.internal.pageSize.height / 2) - (112 / 2),  128, 112);

    // auto print: not works only in chrome, firefox and acrobat reader
    doc.autoPrint();
    doc.save(this.paymentService.form.get('name').value + '-receipt.pdf');
  }

  addWaterMark(doc) {

    // get total number of pages
    const totalPages = doc.internal.getNumberOfPages();
    // const pageHeight = doc.internal.pageSize.height || doc.internal.pageSize.getHeight();
    // const pageWidth = doc.internal.pageSize.width || doc.internal.pageSize.getWidth();

    for (let i = 1; i < totalPages; i++) {
      doc.setPage(i);
      // doc.addImage(this.imgData, 'PNG', 300, 421, 170, 150);
    }

    return doc;
  }

  currencyFormat(currency) {
    const num = parseFloat(currency);
    return 'N ' + num.toFixed(2).replace(/(\d)(?=(\d{3})+(?!\d))/g, '$1,');
  }

  close(): void {
    this.dialogRef.close(false);
  }

}
